import React, {useState} from "react"

function Count() {
    const [count, setCount] = useState(0)

    return(
        <div>
            <h1>count is {count}</h1>
            <button
                onClick={ () => setCount(count + 1)}
            >
                Change!
            </button>
        </div>
    )
}

export default Count
